import React, { useState } from 'react';
import Graph from './Graph';
import { Menu } from '@headlessui/react';
import { ChevronDownIcon } from '@heroicons/react/24/solid';
import subscribebtn from "../../../assets/Pics/Label.svg";
import DatePicker from 'react-datepicker';
import 'react-datepicker/dist/react-datepicker.css';

const DashboardVenueProfile = () => {

  const venues = [
    { id: 1, name: 'Venue 1' },
    { id: 2, name: 'Venue 2' },
    { id: 3, name: 'Venue 3' },
    // Add more dummy venues as needed
  ];

  const [startDate, setStartDate] = useState(null);
  const [endDate, setEndDate] = useState(null);

  const handleDateChange = (dates) => {
    const [start, end] = dates;
    setStartDate(start);
    setEndDate(end);
  };

  const calculateDuration = (start, end) => {
    if (!start || !end) return null;
    const duration = Math.ceil((end - start) / (1000 * 60 * 60 * 24));
    return duration;
  };

  const duration = calculateDuration(startDate, endDate);
  return (
    <div className="p-4 md:p-8 bg-gray-50 min-h-screen">
      <header className="flex flex-col md:flex-row justify-between items-start md:items-center">
        <div>
          <h1 className="text-xl md:text-3xl font-bold flex items-center">
            Hello Kushal,
            <span style={{cursor:"pointer",marginLeft:"7px"}} ><img src={subscribebtn} alt="" /></span>
          </h1>
          <p className="text-gray-500 text-l mt-2">Check out how your venue is doing</p>
        </div>
        <div className="flex flex-col md:flex-row items-start md:items-center mt-4 md:mt-0 space-y-4 md:space-y-0 md:space-x-4">
        <Menu as="div" className="relative">
      <Menu.Button className="flex items-center bg-white h-10 border border-black w-48 rounded-lg py-2 px-4">
        All venues
        <ChevronDownIcon className="w-5 h-5 ml-16" />
      </Menu.Button>
      <Menu.Items className="absolute right-0 mt-2 w-48 bg-white shadow-lg rounded-md">
        {venues.map((venue) => (
          <Menu.Item key={venue.id}>
            {({ active }) => (
              <a
                href="#"
                className={`block px-4 py-2 ${active ? 'bg-gray-100' : ''}`}
              >
                {venue.name}
              </a>
            )}
          </Menu.Item>
        ))}
      </Menu.Items>
    </Menu>
          {/* <div className="relative">
            <div className="flex items-center border border-black w-64 h-10 rounded-lg ">
              <input
                type="date"
                className="border-none bg-transparent focus:border-none"
                value={startDate}
                onChange={(e) => setStartDate(e.target.value)}
              />
              <span>-</span>
              <input
                type="date"
                className="border-none bg-transparent focus:border-none"
                value={endDate}
                onChange={(e) => setEndDate(e.target.value)}
              />
            </div>
          </div> */}
           <div className="relative">
      <div className="flex items-center border border-black p-4 w-64 h-10 rounded-lg py-2">
        <DatePicker
          selected={startDate}
          onChange={handleDateChange}
          startDate={startDate}
          endDate={endDate}
          selectsRange
          inline
          className="w-full border-none bg-transparent focus:border-none"
        />
      </div>
      {/* {duration !== null && (
        <div className="mt-2">
          Duration: {duration} {duration === 1 ? 'day' : 'days'}
        </div>
      )} */}
    </div>
        </div>
      </header>
      <div className="mt-8 grid gap-4 grid-cols-1 md:grid-cols-2">
        <div className="bg-white shadow-md rounded p-4">
          <h2 className="text-xl font-semibold">800 Total Enquiries</h2>
          <p className="text-gray-500">No. of enquiries received on a venue</p>
          <Graph />
        </div>
        <div className="bg-white shadow-md rounded p-4">
          <h2 className="text-xl font-semibold">Enquire status</h2>
          <div className="flex justify-around mt-4">
            <div className="text-center">
              <div className="bg-blue-500 text-white rounded-full h-16 w-16 flex items-center justify-center">250</div>
              <p className="mt-2">Successful</p>
            </div>
            <div className="text-center">
              <div className="bg-yellow-500 text-white rounded-full h-16 w-16 flex items-center justify-center">400</div>
              <p className="mt-2">Active</p>
            </div>
            <div className="text-center">
              <div className="bg-green-500 text-white rounded-full h-16 w-16 flex items-center justify-center">200</div>
              <p className="mt-2">New</p>
            </div>
            <div className="text-center">
              <div className="bg-purple-500 text-white rounded-full h-16 w-16 flex items-center justify-center">20</div>
              <p className="mt-2">Lost</p>
            </div>
          </div>
        </div>
      </div>
      <div className="bg-white shadow-md rounded p-4 mt-8">
        <h2 className="text-xl font-semibold">Performance funnel</h2>
        <p className="text-gray-500">Response time from your team</p>
        {/* Add the Performance funnel graph or content here */}
      </div>
    </div>
  );
};

export default DashboardVenueProfile;
